        public {
            num = 5;
        }
    function getNum()
        public 
        view 
        returns(uint) {
            return num;
        }
}

contract Caller {
    Number internal instance = new Number();
    function changeNumber() 
        public {
            instance.changeNum();
        }
    function getNumber()
        public 
        view 
        returns(uint) {
            return instance.getNum();
        }
}

